-- Table structure for t_invoice
-- ----------------------------
DROP TABLE IF EXISTS `t_invoice`;
CREATE TABLE `t_invoice` (
  `id` bigint(50) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `code` varchar(50) DEFAULT NULL COMMENT '发票代码',
  `number` varchar(50) DEFAULT NULL COMMENT '发票号码',
  `financial_number` varchar(50) DEFAULT NULL COMMENT '财务编号',
  `receipt_number` varchar(50) DEFAULT NULL COMMENT '单据编号 规则：单据编号规则：公司名称首字母4个字母 + 年月日6位 +“4位流水号',
  `date` datetime DEFAULT NULL COMMENT '开票日期',
  `content` varchar(500) DEFAULT NULL COMMENT '发票内容',
  `payee` varchar(50) DEFAULT NULL COMMENT '收款人',
  `drawer` varchar(50) DEFAULT NULL COMMENT '开票人',
  `note_o` varchar(500) DEFAULT NULL COMMENT '备注1',
  `note_t` varchar(500) DEFAULT NULL COMMENT '备注2',
  `note_s` varchar(500) DEFAULT NULL COMMENT '备注3',
  `sname` varchar(50) DEFAULT NULL COMMENT '销售方名称',
  `staxpayer_number` varchar(50) DEFAULT NULL COMMENT '销售方纳税人识别号',
  `saddress_phone` varchar(50) DEFAULT NULL COMMENT '销售方地址、电话',
  `sbank_number` varchar(50) DEFAULT NULL COMMENT '销售方开户行及账号',
  `bname` varchar(50) DEFAULT NULL COMMENT '购买方名称',
  `btaxpayer_number` varchar(50) DEFAULT NULL COMMENT '购买方纳税人识别号',
  `baddress_phone` varchar(50) DEFAULT NULL COMMENT '购买方地址电话',
  `bbank_number` varchar(50) DEFAULT NULL COMMENT '购买方开户行及账号',
  `btotall` decimal(10,2) DEFAULT NULL COMMENT '金额合计（小写）',
  `btax` varchar(50) DEFAULT NULL COMMENT '价税合计（大写）',
  `operator` varchar(20) DEFAULT NULL COMMENT '操作人姓名',
  `opedate` datetime DEFAULT NULL COMMENT '操作时间',
  `img_name` varchar(50) DEFAULT NULL COMMENT '发票图片名称',
  `img_url` varchar(50) DEFAULT NULL COMMENT '图片保存路径',
  `check_code` varchar(50) DEFAULT NULL COMMENT '校验码',
  `password` varchar(500) DEFAULT NULL COMMENT '密码区',
  PRIMARY KEY (`id`),
  UNIQUE KEY `code_number` (`code`,`number`) USING BTREE,
  KEY `receipt_number` (`receipt_number`)
) ENGINE=InnoDB AUTO_INCREMENT=3251 DEFAULT CHARSET=utf8;

